import React, { useState, useEffect } from 'react';
import UpperHeading from '../../Components/UpperHeading';
import './Planets.css';

const Planets = () => {
  const [planets, setPlanets] = useState([]);
  const [nextPage, setNextPage] = useState('');
  const [prevPage, setPrevPage] = useState('');

  useEffect(() => {
    fetch('https://swapi.dev/api/planets/?format=json')
      .then(response => response.json())
      .then(data => {
        setPlanets(data.results);
        setNextPage(data.next);
        setPrevPage(data.previous);
      })
      .catch(error => {
        console.error('Error fetching planets data:', error);
      });
  }, []);

  const handleNextPage = () => {
    if (nextPage) {
      fetch(nextPage)
        .then(response => response.json())
        .then(data => {
          setPlanets(data.results);
          setNextPage(data.next);
          setPrevPage(data.previous);
        })
        .catch(error => {
          console.error('Error fetching next page data:', error);
        });
    }
  };

  const handlePrevPage = () => {
    if (prevPage) {
      fetch(prevPage)
        .then(response => response.json())
        .then(data => {
          setPlanets(data.results);
          setNextPage(data.next);
          setPrevPage(data.previous);
        })
        .catch(error => {
          console.error('Error fetching previous page data:', error);
        });
    }
  };

  return (
    <div>
      <UpperHeading />
      <div className="container mt-5">
        <div className="row">
          {planets.map(planet => (
            <div key={planet.name} className="col-lg-4 planet-button-div">
              <button className='planet-button'>{planet.name}</button>
            </div>
          ))}
        </div>
        <div className="row mt-3">
          <div className="col">
            {prevPage && (
              <button onClick={handlePrevPage}>Previous Page</button>
            )}
          </div>
          <div className="col text-right">
            {nextPage && (
              <button onClick={handleNextPage}>Next Page</button>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Planets;
